export default (function(a,b,c,d,e,f,g,h){return {data:{Xm5LWiswmL:{data:{id:396,attributes:{imdbId:"tt0258463",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BM2JkNGU0ZGMtZjVjNS00NjgyLWEyOWYtZmRmZGQyN2IxZjA2XkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.9\u002F10"},{Source:"Rotten Tomatoes",Value:"83%"},{Source:"Metacritic",Value:"68\u002F100"}],item_lang:{data:{id:1059,attributes:{title:d,plot:"When a body is recovered at sea still alive, the mystery man (Damon) seems to have forgotten everything in life, including who he was. Eventually he begins to remember smaller details in life and soon finds out that his name was Jason Bourne. What he doesn't like is the gun and fake passports belonging to him. Now Bourne, and his new friend, Marie Helena Kreutz (Potente) travel from country to country in search of his new identity. But someone is not happy to see him alive, and is frantically trying to track him down.",slug:"the-bourne-identity"}}},books:{data:[{id:576,attributes:{title:d,description:"#1 NEW YORK TIMES BESTSELLER His memory is a blank. His bullet-ridden body was fished from the Mediterranean Sea. His face has been altered by plastic surgery. A frame of microfilm has been surgically implanted in his hip. Even his name is a mystery. Marked for death, he is racing for survival through a bizarre world of murderous conspirators—led by Carlos, the world’s most dangerous assassin. Who is Jason Bourne? The answer may kill him. BONUS: This edition includes an excerpt from Robert Ludlum's The Bourne Supremacy.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BebwoOZCPr0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:e,publisher:f,subtitle:"Jason Bourne Book #1"}},{id:577,attributes:{title:"Robert Ludlum's The Bourne Legacy",description:"Jason Bourne has gradually come to realise who and what he really is - a strange amalgam of a man named David Webb, and a deadly killer. Now David Webb is living a peaceful life as a university professor in the backwoods of America with his wife and children. But someone is reaching out to take him out of the game for ever. A deadly assassin is on his trail and his former handler has been brutally murdered already. It seems that David Webb must once again turn to Bourne to save his life and family.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zZK5XwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Eric Lustbader",a],firstBook:c,published:"2012-07-31",publisher:b,subtitle:b}},{id:578,attributes:{title:g,description:"#1 NEW YORK TIMES BESTSELLER At a small-town carnival, two men, each mysteriously summoned by telegram, witness a bizarre killing. The telegrams are signed “Jason Bourne.” Only they know Bourne’s true identity and understand that the telegrams are really a message from Bourne’s mortal enemy, Carlos, known also as the Jackal, the world’s deadliest and most elusive terrorist. And furthermore, they know what the Jackal wants: a final confrontation with Bourne. Now David Webb, professor of Oriental studies, husband, and father, must do what he hoped never to do again—assume the terrible identity of Jason Bourne. His plan is simple: to infiltrate the politically and economically omnipotent Medusan group and use himself as bait to lure the cunning Jackal into a deadly trap—a trap from which only one of them will escape.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KM1rjwkN8DwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:e,publisher:f,subtitle:"Jason Bourne Book #3"}},{id:579,attributes:{title:g,description:"It all starts with a cat-and-mouse chase to the death in a Baltimore funfair: the Jackal, Bourne's age-old antagonist, is back and Bourne is forced from his idyllic retirement with his wife and children to confront his enemy. In Europe and America there are men and women whose lust for power is disguised by their positions and respectability. Their aim: to gain control at the highest level, to avenge, to destroy. Jason Bourne has been the assassin before: now he longs for peace with his family, but the threat of the Jackal puts in jeopardy all possibility of peace...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1ZBbPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:h,publisher:"Phoenix",subtitle:b}},{id:580,attributes:{title:d,description:"The man has been shot many times. Who wants to kill him, and why? The man can't remember. As he begins to learn about his past, he becomes even more confused. Does he have a future? Or will he be killed before he knows who - or what - he really is?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KYaERAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:h,publisher:b,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940930911}}("Robert Ludlum","",null,"The Bourne Identity","2012-08-14","Bantam","The Bourne Ultimatum","2010-01-01"))